import React, { useEffect, useState } from "react"
import TattooCard from "../../TattooCard/TattooCard"
import "./Home.css"
import { useAppSelector } from "../../../app/hooks"
import { userSelector } from "../../../features/user/userSlice"
import { useDispatch, useSelector } from "react-redux"
import { getAllImages } from "../../../features/images/imagesAction"
import TattooWrapper from "../../TattooCard/TattooWrapper"
import { AppDispatch } from "../../../app/store";

const Home = () => {
    const dispatch = useDispatch<AppDispatch>();
    const [searchField, setSearchField] = useState('')
    const [searchFilter, setSearchFilter] = useState('')
    
    async function handleSubmit(ev: any) {
        ev.preventDefault();
    
      
        useEffect(() => {
            dispatch(getAllImages())
    
        }, []);
      }
    
           

    

    return (
        <div>
            <form className="searchForm">
            <input onChange={ev => setSearchField(ev.target.value) } className="searchInput" type="text" placeholder="Search for tattoo ideas.."></input>
            <button onClick={(handleSearch) => setSearchFilter(searchField)} className="searchButton">Search</button>
            <TattooWrapper searchFilter={searchFilter} />
            </form>
           
        </div>
    )
}

export default Home
